import React from 'react';
import logo from './logo.svg';
import './App.css';



export class Accueil extends React.Component{
    constructor(props) {
        super(props);
    }
    render() {

            return (<p>Hello {this.props.name}, je suis la page d accueil</p>);

    }
}

export class Configuration extends React.Component{
    constructor(props) {
        super(props);
    }
    render() {
        return super.render(<p>bonjour, je suis la page de configuration</p>);
    }
}

export class Apropos extends React.Component{
    constructor(props) {
        super(props);
    }
    render() {
        return super.render(<p>bonjour, je suis la page de notre equipe</p>);
    }
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
        <body>
        <h1> Our App</h1>
            <div id="root">
                <Accueil name="Gwen"/>
            </div>
        </body>
    </div>
  );
}

ReactDOM.render(
    <App />, document.getElementById('root')
);

export default App;
